import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Adminhome from "./Adminhome";
import Adminresister from "./Adminresister";
import Adminlogin from "./Adminlogin";
import Admingmail from "./Admingmail"
import Adminpassword from "./Adminpassword";
import Admindelete from "./Admindelete";


export default function App() {
  return (
    <Router>
      <div>
        {/* Navigation links */}
        <nav>
          <ul>
            <li>
              <Link to="/Adminhome">Go to Admin Home</Link>
            </li>
            <li>
              <Link to="/Adminresister">Go to Admin Register</Link>
            </li>
            <li>
              <Link to="/Adminlogin">Go to Admin Login</Link>
            </li>
            <li>
              <Link to="/Admingmail">Go to Admin gmail</Link>
            </li>
            <li>
              <Link to="/Adminpassword">Go to Admin password</Link>
            </li>

            <li>
              <Link to="/Admindelete">Go to Admin delete</Link>
            </li>

          </ul>
        </nav>

        {/* Routes */}
        <Routes>
          <Route path="/Adminhome" element={<Adminhome />} />
          <Route path="/Adminresister" element={<Adminresister />} />
          <Route path="/Adminlogin" element={<Adminlogin />} />
          <Route path="/Admingmail" element={<Admingmail />} />
          <Route path="/Adminpassword" element={<Adminpassword />} />
          <Route path="/Admindelete" element={<Admindelete />} />
          <Route path="/" element={<Adminresister />} /> {/* Default route */}
        </Routes>
      </div>
    </Router>
  );
}
